import {useState} from 'react';
import axios from 'axios';
import './App.css';
/* option+shift+down arrow will duplicate something for you!!! */ 
/* after doing that, if you highlight the word you want to change then command+d you can change the word */
function App() {
  const [firstName, setFirstName] = useState('')
  const [lastName, setLastName] = useState('')
  const [email, setEmail] = useState('')
  const [phoneNumber, setPhoneNumber] = useState('')
  const [username, setUsername] = useState('')
  const [userPassword, setUserPassword] = useState('')
  const [hostOrMember, setHostOrMember] = useState('')
  const [hostID, setHostID] = useState('')

  const submitHandler = event => {
    axios.post('http://localhost:8800/signup', { firstName :firstName, lastName : lastName, email : email, phoneNumber : phoneNumber, username : username, userPassword : userPassword, hostOrMember : hostOrMember, hostID : hostID})
    .then((data) => {
      console.log(data)
      setFirstName('')
      setLastName('')
      setEmail('')
      setPhoneNumber('')
      setUsername('')
      setUserPassword('')
      setHostOrMember('')
      setHostID('')

    })
  }
  return (
    <div>
      <form onSubmit={submitHandler}>
        <h3>signUp</h3>
        <label htmlFor='firstName'> firstName</label>
        <input id='firstName' type='text' value = {firstName} onChange={(event) => setFirstName(event.target.value)} />
        <label htmlFor='lastName'> lastName</label>
        <input id='lastName' type='text' value = {lastName} onChange={(event) => setLastName(event.target.value)} />
        <label htmlFor='email'> email</label>
        <input id='email' type='email' value = {email} onChange={(event) => setEmail(event.target.value)} />
        <label htmlFor='phoneNumber'> phoneNumber</label>
        <input id='phoneNumber' type='number' value = {phoneNumber} onChange={(event) => setPhoneNumber(event.target.value)} />
        <label htmlFor='username'> Username</label>
        <input id='username' type='text' value = {username} onChange={(event) => setUsername(event.target.value)} />
        <label htmlFor='userPassword'> userPassword</label>
        <input id='userPassword' type='password' value = {userPassword} onChange={(event) => setUserPassword(event.target.value)} />
        <label htmlFor='hostOrMember'> hostOrMember</label>
        <input id='hostOrMember' type='text' value = {hostOrMember} onChange={(event) => setHostOrMember(event.target.value)} />
        <label htmlFor='hostID'> hostID</label>
        <input id='hostID' type='text' value = {hostID} onChange={(event) => setHostID(event.target.value)} />
        <div>
          <button type='button'> Cancel</button>
          <button type='submit'> Submit</button>
        </div>
      </form>

    </div>
  )
}

export default App;
